class Test_cyclic_shift(unittest.TestCase):
    def test_wrong_number_params(self):
        with self.assertRaises(TypeError) as cm_new:
            fu.cyclic_shift()
        with self.assertRaises(TypeError) as cm_old:
            oldfu.cyclic_shift()
        self.assertEqual(
            str(cm_new.exception), "cyclic_shift() missing 1 required positional argument: 'img'"
        )
        self.assertEqual(str(cm_new.exception), str(cm_old.exception))

    def test_NoneType_input_img_returns_AttributeError(self):
        with self.assertRaises(AttributeError) as cm_new:
            fu.cyclic_shift(img=None)
        with self.assertRaises(AttributeError) as cm_old:
            oldfu.cyclic_shift(img=None)
        self.assertEqual(
            str(cm_new.exception), "'NoneType' object has no attribute 'copy'"
        )
        self.assertEqual(str(cm_new.exception), str(cm_old.exception))

    @unittest.skip("skip because SIGFPE")
    def test_EmptyType_input_img_crash_because_SIGFPE(self):
        with self.assertRaises(AttributeError)  as cm_new:
            fu.cyclic_shift(img=EMData(), dx=0, dy=0, dz=0)
        with self.assertRaises(AttributeError)  as cm_old:
            oldfu.cyclic_shift(img=EMData(), dx=0, dy=0, dz=0)
        self.assertEqual(str(cm_new.exception), "'NoneType' object has no attribute 'copy'")
        self.assertEqual(str(cm_new.exception), str(cm_old.exception))

