    def test_3Dimg_noNormalizated_retFourier(self):
        return_new = fu.fdecimate(
            image=IMAGE_3D,
            nnx=IMAGE_3D.get_xsize(),
            nny=IMAGE_3D.get_ysize(),
            nnz=IMAGE_3D.get_zsize(),
            RetReal=True,
            normalize=False,
        )
        return_old = oldfu.fdecimate(
            image=IMAGE_3D,
            nnx=IMAGE_3D.get_xsize(),
            nny=IMAGE_3D.get_ysize(),
            nnz=IMAGE_3D.get_zsize(),
            RetReal=True,
            normalize=False,
        )
        self.assertTrue(array_equal(return_new.get_3dview(), return_old.get_3dview()))
