class Test_prepi(unittest.TestCase):
    def test_wrong_number_params(self):
        with self.assertRaises(TypeError) as cm_new:
            fu.prepi()
        with self.assertRaises(TypeError) as cm_old:
            oldfu.prepi()
        self.assertEqual(
            str(cm_new.exception), "prepi() missing 1 required positional argument: 'image'"
        )
        self.assertEqual(str(cm_new.exception), str(cm_old.exception))

    def test_empty_input_img_returns_ZeroDivisionError(self):
        with self.assertRaises(ZeroDivisionError) as cm_new:
            fu.prepi(image=EMData())
        with self.assertRaises(ZeroDivisionError) as cm_old:
            oldfu.prepi(image=EMData())
        self.assertEqual(str(cm_new.exception), "float division by zero")
        self.assertEqual(str(cm_new.exception), str(cm_old.exception))

    def test_Nonetype_input_img(self):
        with self.assertRaises(AttributeError) as cm_new:
            fu.prepi(image=None)
        with self.assertRaises(AttributeError) as cm_old:
            oldfu.prepi(image=None)
        self.assertEqual(
            str(cm_new.exception), "'NoneType' object has no attribute 'get_xsize'"
        )
        self.assertEqual(str(cm_new.exception), str(cm_old.exception))

    def test_2DimgBlank_retFour(self):
        return_new = fu.prepi(image=IMAGE_BLANK_2D, RetReal=False)
        return_old = oldfu.prepi(image=IMAGE_BLANK_2D, RetReal=False)
        self.assertTrue(
            array_equal(return_new[0].get_2dview(), return_old[0].get_2dview())
        )

        self.assertTrue(
            array_equal(return_new[1].dump_table(), return_old[1].dump_table())
        )  # it is a kaiserbessel filter

    def test_2Dimg_retFour(self):
        return_new = fu.prepi(image=IMAGE_2D, RetReal=False)
        return_old = oldfu.prepi(image=IMAGE_2D, RetReal=False)
        self.assertTrue(
            array_equal(return_new[0].get_2dview(), return_old[0].get_2dview())
        )
        self.assertTrue(
            array_equal(return_new[1].dump_table(), return_old[1].dump_table())
        )  # it is a kaiserbessel filter


    def test_2Dimg_retReal(self):
        return_new = fu.prepi(image=IMAGE_2D, RetReal=True)
        return_old = oldfu.prepi(image=IMAGE_2D, RetReal=True)
        self.assertTrue(
            array_equal(return_new[0].get_2dview(), return_old[0].get_2dview())
        )

        self.assertTrue(
            array_equal(return_new[1].dump_table(), return_old[1].dump_table())
        )  # it is a kaiserbessel filter


    def test_2DimgBlank_retReal(self):
        return_new = fu.prepi(image=IMAGE_BLANK_2D, RetReal=True)
        return_old = oldfu.prepi(image=IMAGE_BLANK_2D, RetReal=True)
        self.assertTrue(
            array_equal(return_new[0].get_2dview(), return_old[0].get_2dview())
        )

        self.assertTrue(
            array_equal(return_new[1].dump_table(), return_old[1].dump_table())
        )  # it is a kaiserbessel filter


    def test_3Dimg_returns_RuntimeError(self):
        with self.assertRaises(RuntimeError) as cm_new:
            fu.prepi(image=IMAGE_3D, RetReal=False)
        with self.assertRaises(RuntimeError) as cm_old:
            oldfu.prepi(image=IMAGE_3D, RetReal=False)
        msg = str(cm_new.exception).split("'")
        msg_old = str(cm_old.exception).split("'")
        self.assertEqual(msg[0].split(" ")[0], "ImageDimensionException")
        self.assertEqual(msg[1], "Cannot reduce the image size")
        self.assertEqual(msg[0].split(" ")[0], msg_old[0].split(" ")[0])
