    def test_3Dimg_Zero_scale_returns_RuntimeError(self):
        with self.assertRaises(RuntimeError) as cm_new:
            fu.rot_shift3D(
                image=IMAGE_3D,
                phi=0,
                theta=0,
                psi=0,
                sx=0,
                sy=0,
                sz=0,
                scale=0,
                mode="background",
            )
        with self.assertRaises(RuntimeError) as cm_old:
            oldfu.rot_shift3D(
                image=IMAGE_3D,
                phi=0,
                theta=0,
                psi=0,
                sx=0,
                sy=0,
                sz=0,
                scale=0,
                mode="background",
            )
        msg = str(cm_new.exception).split("'")
        msg_old = str(cm_old.exception).split("'")
        self.assertEqual(msg[0].split(" ")[0], "InvalidValueException")
        self.assertEqual(
            msg[3],
            "The scale factor in a Transform object must be positive and non zero",
        )
        self.assertEqual(msg[0].split(" ")[0], msg_old[0].split(" ")[0])
        self.assertEqual(msg[3], msg_old[3])

