        with self.assertRaises(ValueError) as cm_old:
            oldfu.mulmat(m1=a, m2=b, tolistconv=True)
        self.assertEqual(str(cm_new.exception), "axes don't match array")
        self.assertEqual(str(cm_new.exception), str(cm_old.exception))

